import React from "react";
import "./Navbar.css";
import logo from "../assets/logo.png";

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="left"> {/* Changed to lowercase */}
        <img src={logo} alt="Osumare Logo" className="logo-img" />
      </div>

      <div className="right"> {/* Changed to lowercase */}
        <button className="contact-button">Contact us</button>
      </div>
    </nav>
  );
};

export default Navbar;
